import React from 'react';
import './LatestStories.css';

const LatestStories = () => {
  const stories = [
    {
      id: 1,
      title: '10 Key Kitchen Dimensions You Need to Know',
      category: 'Popular',
      image: '/images/story-1.jpg',
      readTime: '5 min read'
    },
    {
      id: 2,
      title: '35 Serene Puja Room Designs',
      category: 'Popular',
      image: '/images/story-2.jpg',
      readTime: '8 min read'
    },
    {
      id: 3,
      title: 'What Are the Benefits of Hiring an Interior Designer?',
      category: 'Popular',
      image: '/images/story-3.jpg',
      readTime: '6 min read'
    },
    {
      id: 4,
      title: 'Turn One Room Into Two With These Genius Ideas',
      category: 'Popular',
      image: '/images/story-4.jpg',
      readTime: '7 min read'
    }
  ];

  return (
    <section className="latest-stories section">
      <div className="container">
        <div className="section-header">
          <h2 className="section-title">Latest Stories</h2>
          <a href="#" className="see-all-link">See All</a>
        </div>
        
        <div className="stories-grid">
          {stories.map(story => (
            <article key={story.id} className="story-card card">
              <div className="story-image">
                <img src={story.image} alt={story.title} />
                <span className="story-category">{story.category}</span>
              </div>
              <div className="story-content">
                <h3 className="story-title">{story.title}</h3>
                <div className="story-meta">
                  <span className="read-time">{story.readTime}</span>
                </div>
              </div>
            </article>
          ))}
        </div>
        
        <div className="navigation-arrows">
          <button className="nav-arrow prev">‹</button>
          <button className="nav-arrow next">›</button>
        </div>
      </div>
    </section>
  );
};

export default LatestStories;
